import * as S from "./styles";
import { FiMapPin } from "react-icons/fi";

import roomImg from "../../images/room.jpg";

export const RoommatesMap = () => {
  return (
    <S.RoommatesMapWrapper>
      <S.RoommatesMapContent>
        <S.Rooms>
          <S.Room>
            <img src={roomImg} alt="" />
            <S.Info>
              <S.Title>
                The People's Brownstone
                <S.Address>
                  <FiMapPin /> 1995 Broadway, New York
                </S.Address>
              </S.Title>

              <S.Description>
                Wifi • Air conditioning • Kitchen • Heating • Smokers • Parking
                • Balcony • Animal friendly
              </S.Description>
              <S.Price>R$3,000/mês</S.Price>
            </S.Info>
          </S.Room>
        </S.Rooms>
        <S.Map>Mapa</S.Map>
      </S.RoommatesMapContent>
    </S.RoommatesMapWrapper>
  );
};
